import './App.css';
import ExpenseItem from './components/others/ExpenseItem';

function App() {
  return (
    <div>
        <h2>CONTENT</h2>
        <ExpenseItem title='Car Expenses'></ExpenseItem>
        <ExpenseItem></ExpenseItem>
        <ExpenseItem></ExpenseItem>
        <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
